import React from 'react'
import EntityDisplay from './EntityDisplay'

const SystemDisplay = props => {

    const entity = {
        position: [75, 75],
        color: "blue",
        radius: 5,
    }

    const sun = {
        position: [140, 140],
        color: "yellow",
        radius: 5,
    }

    return (
        <div className="space">
            <EntityDisplay entity={entity} />
            <EntityDisplay entity={sun} />
        </div>
    )
}

export default SystemDisplay
